/*

--Дубли кодов узлов ТМ супа по филиалу
select sd.C_Name,eni.C_name, eni.string4,count(eni.link) from dbo.ED_Network_Items eni
left join dbo.SD_Divisions sd
on sd.LINK=eni.F_Division
where eni.string4 is not null
and sd.link = 61
group by sd.C_Name,eni.string4,eni.C_name
having count(eni.link)>1
order by sd.C_Name,count(eni.link)

